void SodaPlayer::buttonClicked (Button* buttonThatWasClicked)
{
    //[UserbuttonClicked_Pre]
    //[/UserbuttonClicked_Pre]

    if (buttonThatWasClicked == playButton.get())
    {
        //[UserButtonCode_playButton] -- add your button handler code here..
		sodaCanvas->addPlaybackSettings(ESodaPlayback::Playback_Playing);
        //[/UserButtonCode_playButton]
    }
    else if (buttonThatWasClicked == reverseButton.get())
    {
        //[UserButtonCode_reverseButton] -- add your button handler code here..
		if(isReversed)
			sodaCanvas->removePlaybackSettings(ESodaPlayback::Playback_Reversed);
		else
			sodaCanvas->addPlaybackSettings(ESodaPlayback::Playback_Reversed);
		isReversed = !isReversed;
        //[/UserButtonCode_reverseButton]
    }
    else if (buttonThatWasClicked == pauseButton.get())
    {
        //[UserButtonCode_pauseButton] -- add your button handler code here..
		sodaCanvas->removePlaybackSettings(ESodaPlayback::Playback_Playing);
        //[/UserButtonCode_pauseButton]
    }

    //[UserbuttonClicked_Post]
    //[/UserbuttonClicked_Post]
}



